import React from 'react';
import { BrowserRouter, Routes, Route } from 'react-router-dom';
import RegistrationForm from './Signup'; // Importing RegistrationForm component
import Login from './Login'; // Importing Login component


function App() {
  return (
    <div>
      <BrowserRouter>
        <Routes>
          <Route path="/signup" element={<RegistrationForm />} /> {/* Use RegistrationForm for root path */}
          <Route path="/signup" element={<RegistrationForm />} /> {/* Use RegistrationForm for /home path */}
          <Route path="/login" element={<Login />} /> {/* Use Login for /login path */}
        </Routes>
      </BrowserRouter>

    </div>
  );
}

export default App;
